import React from "react";
import Form from "./common/form";
import { logOut } from "../services/authService";

class Profile extends Component {
  state = {};
  render() {
    return (
      <div className="container shadow rounded-1 bg-white my-4">
        <button
          onClick={() => {
            logOut();
            window.location = "/";
          }}
        >
          logOut
        </button>
      </div>
    );
  }
}

export default Profile;
